import React,{Component} from 'react';
import Layout from '../../components/layout'

class UpdateShow extends Component{

	constructor(props){
		super(props);
		this.state = {
			admin : false
		}
	}

	render(){

		return(
			<Layout
				id={'Admin'}
			>
				HII
			</Layout>
		)
	}
}

export default UpdateShow
